export default function Reset () {

	const dispatch = useDispatch()

    function handleReset(){
        dispatch(getCountry())
    };


    return(

        <div>
    <Link to = '/home'><button className={style.button}>Reset Filters</button>
              </Link>
      </div>

    )
};



